import React from 'react';
import { Navigate, Outlet } from 'react-router-dom';

const PrivateRoute = (Element) => {
    var auth = false; 
    if(localStorage.getItem('auth_token')){
        var auth = true; 
    }

    return auth ? <Element /> :  navigate('/login')
}

export default PrivateRoute;
